import React from "react";
import BlogCard from '../components/card/BlogCard'

function Blog() {
  return (
    <div>
      <BlogCard 
        likes="1"
        title="{post.title}"
        author="{post.author}"
        content="{post.content}"
      />
    </div>
  );
}

export default Blog;
